	void strappend(string input) {
		// 向后添加元素。
		// 把元素内容加载内容字符串的后面。
		content = content + input;
		// 元素首位位置的if判断句，采用长度到达峰值1024时禁止添加。
		if (length <= 1024) {
			if (length = 0) {
			}
			else {
				element_position[length] = element_position[length - 1] + element_length[length - 1];
			}
			// 向element_length中元素位数的位置添加其长度。
			element_length[length] = input.length();
			// 向type声明其类型。
			type += "s";
			length++;
		}
		else {
			cout << "Too much elements! ( max = 1024 but get more. )" << endl;
			cout << "元素数量太多。（最大允许1024个元素但是被加入了超过1024个元素。）" << endl;
		}
		return;
	}
